import React, { Component } from 'react'
import './work.css'
import Header from '../components/header'

class Work extends Component {
    render() {
        return (
            <div className='body'>
                <Header></Header>
                <div className='bodyHeader' style={{position:'fixed',top:'125px'}}>
                    <p>WORK</p>
                </div>
                <div className='bodyIntro' style={{position:'fixed', top:'150px'}}>
                    <p>I've done work with UX Design, frontend dev, and backend dev.
                        <br></br>
                    Below are some examples of each.
                    </p>
                </div>
            </div>
        )
    }
}
export default Work;
